        this.setRotateAngle(Arm6, -0.7F, 0.3F, 0.0F);
        this.setRotateAngle(Arm7, 0.3F, -0.3F, 0.0F);
        this.setRotateAngle(Arm8, -0.7F, 0.3F, 0.0F);
        this.setRotateAngle(Arm9, 0.3F, -0.3F, 0.0F);
