        super.setLivingAnimations(entitylivingbaseIn, limbSwing, limbSwingAmount, partialTickTime);        this.resetToDefaultPose();
        EntityPrehistoricFloraSaccocoma ee = (EntityPrehistoricFloraSaccocoma) entitylivingbaseIn;
